function getCSRFToken(r,s){var e="";$.when($.ajax({url:APP_URL+"/csrf_token",type:"get",dataType:"json",success:function(r){r=JSON.parse(JSON.stringify(r)),"success"==r.status?e=r.data.csrf_token:null!=r.messages?showAlertPopUp("Error",r.messages):showAlertPopUp("Error",r.error)},error:function(r,s,e){showAlertPopUp("Error",e)}})).done(function(){r(e,s)})}